import { useState } from 'react';
import './App.css';
import Form from './components/Form';
import List from './components/List';
import TotalMoney from './components/TotalMoney';
import Header from './components/Header';

function App() {

  const [listTransactions, setListTransactions] = useState([
    // { description: "Salário recebido", type: "entrada", value: 2500, id: 1 },
    // { description: "Conta de luz", type: "saída", value: -150, id: 2 }
  ])

  return (
    <div className="App">
        <div className='Header'>
          <Header/>
        </div>
        <div className="General"> 

          <div className='First-Colum'>
            { <Form 
            listTransactions={listTransactions}
            setListTransactions={setListTransactions}
            />}

            { <TotalMoney 
              listTransactions={listTransactions}
              setListTransactions={setListTransactions}
              />}
          </div>

          <div className='Colum-2'>
            <div className='Header-Colum-2'>
              <div className='Btns-Colum-2'>
                <p className='Res-Fin'>Resumo financeiro</p>
                  <button>Todos</button>
                  <button>Entradas</button>
                  <button>Despesas</button>
              </div>
              <div className="List">  
              {<List 
              listTransactions={listTransactions}
              />}
            </div> 
            </div> 
          </div>

        </div> 



    </div>
  );
}

export default App;
